import React, { useState, useEffect } from "react";
import axios from "axios";

const ListForm = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await axios.get("/api/list");
      setData(response);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div>
      {data.map((d) => (
        <div>{d.title}</div>
      ))}
    </div>
  );
};

export default ListForm;
